  "continuation": "Me alimento de pan y con las sobras
que me regalan otras buenas almas,
paso la vida sin pensar en nada.
Mi gorra es vieja, mi levita es pobre,
pero soy feliz y a nadie envidio;
tal es mi vida: triste y sosegada."
}

Este soneto es obra del poeta peruano Manuel González Prada, titulado "El Vagabundo", aunque también es conocido simplemente como "Soneto". El poema refleja la vida simple y libre de un vagabundo que se conforma con poco y encuentra paz en su estilo de vida despreocupado.
